int majorityElement(vector<int>& nums)
{
    const int size = nums.size() - 1;
    int output = nums[0];
    int count = 1;
    for(int i = 1; i <= size; i++) {
        if(nums[i] == output)
            count++;
        else
            count--;

        if(count == 0) {
            output = nums[i];
            count = 1;
        }
    }
    return output;
}

